import React from "react";
import { Card } from "react-bootstrap";

const Ass = (props) => {
  return (
    <div>
      <>
        <Card
          style={{ width: "13.8rem", border: `none`, marginBottom: `10px` }}
          className="card"
        >
          <Card.Img variant="top" src={props.access.imgUrl} />
          <Card.Body>
            <Card.Title> {props.access.name}</Card.Title>
            <Card.Text>
              <p>{props.access.price}</p>
            </Card.Text>
          </Card.Body>
        </Card>
      </>
    </div>
  );
};

export default Ass;
